import React from "react";

const SemesterCurses = ({semesterCurses}) => {
    return (
        <div>
            {semesterCurses.map(sc => 
                <ul>
                    <li>{sc.id_semester}</li>
                    <li>{sc.id_curses}</li>
                    <li>{sc.date_start}</li>
                    <li>{sc.date_end}</li>
                </ul>
                )}
        </div>
    )
}

export default SemesterCurses
